import React from "react";

const Header = () => {
  return (
    <header className="bg-pink-600 p-4 shadow-md text-white flex justify-between items-center">
      <h1 className="text-2xl font-bold">Potato Disease Classifier</h1>
    </header>
  );
};

export default Header;
